import styled from "styled-components";
import { Row } from "antd";
export const WrapperHeader = styled(Row)`
        padding: 20px 120px;
        background-color: #ffd400;
`
export const WrappertextHeader = styled(Row)`
        font-size: 18px;
        color: #000;
        font-weight: bold;
        text-align: left;
`
export const WrapperAccoutHeader = styled(Row)`
        display: flex;
        align-items: center;
`
